import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "edit";
const pathData = "M503 94c12 12 12 29 0 40l-85 85-284 285c-6 6-12 8-20 8H28c-17 0-28-11-28-28v-85c0-9 3-15 9-20L293 94l85-85c12-11 29-11 40 0zM114 444l244-244-45-46L68 399zm284-284l46-46-46-45-45 45z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
